    false,nt"url": null,nt"notes": "The digital Flood Insurance Rate Map (FIRM)
    database depicts flood risk informatino and supporting data used to develop the
    risk data. The primary risk classifications used are the 1-percent-annual-chance
    flood event, the 0.2-percent-annual-chance flood event, and areas of minimal flood
    risk. The FIRM database is derifed from Flood Insurance Studies (FISs), previously
    issued Flood Insurance Rate Maps (FIRMs), flood hazard analyses performed in support
    of the FISs and FIRMs, and new mapping data, where available. The FISs and FIRMs
    are published by the Federal Emergency Management Agency.",nt"license_title":
